import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faArrowRight } from "@fortawesome/free-solid-svg-icons";
import "../styles/TotalItems.css";
const TotalItems = ({ cart, cartUI, toggleCart }) => {
  if (cartUI) {
    return (
      <div className="TotalItems">
        <FontAwesomeIcon icon={faArrowRight} onClick={toggleCart} />
        <div>{"Total Items: " + cart[0].price}</div>
        <div className="items">
          <div className="item-names"></div>
          <div className="item-prices"></div>
        </div>
      </div>
    );
  }
};

export default TotalItems;
